script: |
  super -f text -I q7811.sql | sort > q7811.out

inputs:
  - name: q7811.sql
    data: |
      SELECT ALL col2 col1 FROM tab2 WHERE - - 96 / CAST ( col0 AS INTEGER ) * + col2 - 83 - 24 * - col0 NOT BETWEEN - 33 AND - col1 * col0 - - 44;
  - name: tab2

outputs:
  - name: q7811.out
    data: |
      23
      40
      58
